      <ul>
        {fruit.map((fruit, index) => <li key={index}>{fruit}</li>)}
      </ul>
      <input type='text' id="fruitinput" placeholder="Enter fruit name" />
      <button onClick={handleAddFood}>Add food</button>
    </div>
  );
}

